import PropTypes from 'prop-types';
import { formatCurrency, translationHelper } from '../../helpers';

import {
  Table,
  Card,
  CardBody,
} from "reactstrap"
import React from 'react';


const CorporateExposure = (props) => {

  if (!props.items) {
    return null;
  }

  const t = translationHelper('commercial_credit');

  const dataRows =[];

  
  return (
    <React.Fragment>
      <Card>
        <CardBody>
      <h5>{props.title}</h5>
        <p className="card-title-desc">
        </p>
        <div className="table-responsive">
          <Table className="table mb-0">
            <thead className="table-light">
              <tr>
                <th></th>
                <th className="text-end">{ t("Approved") }</th>                
                <th className="text-end">{ t("Proposed") }</th>
                <th className="text-end">{ t("Difference") }</th>
                <th className="text-end">{ t("LTV") }</th>
              </tr>
            </thead>
            <tbody>
              {dataRows}
            </tbody>
          </Table>
        </div>
        </CardBody>
        </Card>
        </React.Fragment>
  );

};

CorporateExposure.propTypes = {
  title: PropTypes.string,
  items: PropTypes.array.isRequired
};


export default CorporateExposure;
